package com.learning.hackerrank;

public class SpecialStringAgain {
    public static void main(String[] args) {

        print(0, 5);


        //System.out.println(substrCount(65476, ""));
        //System.out.println(substrCount(5, "aabbb"));
    }

    static void print(int i, int n) {
        if (i < n) {
            System.out.println(i);
        } else {
            return;
        }
        i++;
        print(i, n);
    }

    static long substrCount(int n, String s) {
        long count = n;
        char temp = 0;

        for (int i = 0; i < n; i++) {

            int same = 0;

            for (int j = i; j < n; j++) {

                if (temp != 0) {
                    if (temp != s.charAt(j)) {
                        temp = s.charAt(j - 1);

                        if (temp == s.charAt(j)) {
                            same++;
                            continue;
                        }

                        break;
                    }

                    if (temp == s.charAt(j)) {
                        same++;
                        //count++;
                        temp = s.charAt(j - 1);
                    }
                }

                if (temp == 0) {
                    temp = s.charAt(j);
                    break;
                }
            }

            if (same > 2) {
                for (int a = 0; a < same; a++) {
                    for (int b = a; b < same; b++) {
                        count++;
                    }
                }
                i += same - 1;
            } else if (same > 0 && same <= 2) {
                count += same;
                i += same - 1;
            }
        }
        return count;
    }
}
